import { Carousel, Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import img1 from "assets/images/fondo3.jpg"
import img2 from "assets/images/fondo4.jpg"
import img3 from "assets/images/fondo5.png"



function Carrusel() {
  return (
    <Container>
    <Carousel
      sx={{
        backgroundImage: ({ palette: { gradients }, functions: { linearGradient, rgba } }) =>
            `${linearGradient(
              rgba(gradients[color] ? gradients[color].main : gradients.info.main, 0.5),
              rgba(gradients[color] ? gradients[color].main : gradients.info.main, 0.8)
            )}, url(${image})`,
        }}
    >
    <Carousel.Item>
          <div
            style={{
              backgroundImage: `url(${img1})`,
              backgroundSize: "cover",
              backgroundPosition: "fit",
              height: "35vw", // Ajusta la altura según tus necesidades
            }}
          />
          <Carousel.Caption>
            <h3>Comienzos de integración a invernadero</h3>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <div
            style={{
              backgroundImage: `url(${img2})`,
              backgroundSize: "cover",
              backgroundPosition: "center",
              height: "35vw", // Ajusta la altura según tus necesidades
            }}
          />
          <Carousel.Caption>
            <h3>Forma ejemplificada del invernadero</h3>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <div
            style={{
              backgroundImage: `url(${img3})`,
              backgroundSize: "cover",
              backgroundPosition: "center",
              height: "35vw", // Ajusta la altura según tus necesidades
            }}
          />
          <Carousel.Caption>
            <h3>Forma ejemplificada del invernadero</h3>
          </Carousel.Caption>
        </Carousel.Item>
    </Carousel>
  </Container>
  );
};

export default Carrusel;
